def simulate_model(trial_data, beta0=0, beta1=0):
    model_predictions = []
    for trial in trial_data:
        if trial.get('forced_choice') == 'FALSE':
            split_self = trial.get("split_self")
            token_self = trial.get("token_self")
            token_opp = trial.get("token_opp")
            combined_earning = trial.get("combined_earning")

            # Avoid division by zero
            if (token_self + token_opp) == 0:
                fairness_benchmark = 0
            else:
                fairness_benchmark = (token_self / (token_self + token_opp)) * combined_earning

            U_accept = beta0 + beta1 * (split_self - fairness_benchmark)
            model_predictions.append(U_accept)
        else:
            model_predictions.append(None)  # Or some other placeholder value
    return model_predictions
